desc:
Whenever an entity that has this enchantment on one of its associated items is damaged this method will be called.

@param user An instance of the entity that is associated with this enchantment.
@param attacker An instance of the entity that has attacked the using entity.
@param level The level of the enchantment used.

Called whenever a mob is damaged with an item that has this enchantment on it.

@param user An instance of the entity which used the enchantment. This is normally an EntityPlayer.
@param target An instance of the damaged entity.
@param level The level of the enchantment used.

Adds a player to the given team

@param player The name of the player to add
@param newTeam The name of the team

Adds a smelting recipe, where the input item is an instance of Block.

@param input The block to be used as the input for the smelting recipe.
@param stack The output for this recipe in the form of an ItemStack.
@param experience The amount of experience this recipe will give the player.

Adds a smelting recipe using an ItemStack as the input for the recipe.

@param input The input ItemStack for this recipe.
@param stack The output ItemStack for this recipe.
@param experience The amount of experience this recipe will give the player.

Adds a smelting recipe using an Item as the input item.

@param input The input Item to be used for this recipe.
@param stack The output ItemStack for this recipe.
@param experience The amount of experience this recipe will give the player.

Calculates the additional damage that will be dealt by an item with this enchantment. This alternative to calcModifierDamage is sensitive to the targets EnumCreatureAttribute.

@param level The level of this specific enchantment.
@param creatureType The EnumCreatureAttribute which represents the target entity. This can be used to have an effect only apply to a specific group of creatures such as Undead or Arthropods.

Creates a Vec3 using the pitch and yaw of the entities rotation.

@param pitch The rotational pitch of the entity.
@param yaw The rotational yaw of the entity.

Sets the text of the chat

@param newChatText The new chat text to be set
@param shouldOverwrite Determines if the text currently in the chat should be overwritten or appended

Checks to see if a given block is both water and cold enough to freeze.

@param pos The block coordinates
@param noWaterAdj If true, this method will only return true if there is a non-water block immediately adjacent to the specified block

Checks to see if a given block can accumulate snow from it snowing

@param pos The block coordinates
@param checkLight If false, checking for the correct light values will be skipped

Attempts to extinguish a fire

@param player The player putting out the fire
@param pos The coordinates of the fire
@param side The side from which the player is putting out the fire from

Helper method for cycleProperty.

@param values The collection of values
@param currentValue The current value

Offsets the position of pos in the direction of finger and thumb facing by offset amounts, follows the right-hand rule for cross products (finger, thumb, palm) @return A new BlockPos offset in the facing directions

@param pos The original block position
@param finger Finger direction
@param thumb Thumb direction
@param palmOffset An amount to offset in the palm direction. Palm is the direction of the result of the cross-product between finger and thumb
@param thumbOffset An amount to offset in the thumb direction
@param fingerOffset An amount to offset in the finger direction

Calculate squared distance to the given coordinates

@param toX X Coordinate
@param toY Y Coordinate
@param toZ Z Coordinate

Add the given coordinates to the coordinates of this BlockPos

@param x X coordinate
@param y Y coordinate
@param z Z coordinate

Offsets this BlockPos n blocks in the given direction

@param facing The direction of the offset
@param n The number of blocks to offset by

Like getAllInBox but reuses a single MutableBlockPos instead. If this method is used, the resulting BlockPos instances can only be used inside the iteration loop.

@param from The first corner (inclusive)
@param to the second corner (exclusive)

Create an Iterable that returns all positions in the box specified by the given corners

@param from The first corner (inclusive)
@param to the second corner (exclusive)

Add the given coordinates to the coordinates of this BlockPos

@param x X coordinate
@param y Y coordinate
@param z Z coordinate

Copies the angles from one object to another. This is used when objects should stay aligned with each other, like the hair over a players head.

@param source the object that is used for reference
@param dest the object that is updated with the new values

Draw this primitve. This is typically called only once as the generated drawing instructions are saved by the renderer and reused later.

@param renderer The renderer instance
@param scale The amount of scale to apply to this object

Remove the given ScoreObjective for the given Entity name.

@param name The entity Name
@param objective The ScoreObjective

Called when a player completes the destruction of a block

@param pos The block's coordinates
@param side The side it was destroyed from

Create a Map from the given keys and values. This method creates a LinkedHashMap.

@param keys the keys for the map, in order
@param values the values for the map, in order

Get an NBTTagCompound from this stack's NBT data.

@param key The NBTTagCompound to get
@param create Whether a new, empty compound should be created if none is present yet

Activate the clicked on block, otherwise use the held item.

@param pos The block's coordinates
@param side The side of the block that was clicked on

Get the World coordinates of the Block with the given Chunk coordinates relative to this chunk

@param x X coordinate of the Block in this chunk (0-15)
